import React from 'react';
import { Link } from 'react-router-dom';

const Header: React.FC = () => {
  return (
    <header>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/inventory">Inventory</Link>
      </nav>
    </header>
  );
};

export default Header;
